const productStyle = {
  section: {
    padding: "70px 0",
    textAlign: "center"
  },
  title: {
    //color: "#D3E0DB",
    margin: "1.75rem 0 0.875rem",
    textDecoration: "none",
    fontWeight: "700",
    fontFamily: `"Times New Roman", serif`,
    marginBottom: "1rem",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none",
    color: "#FFFFFF",
  },
  description: {
    //color: "#BED0CA"
    color: "#999",
  }
};

export default productStyle;
